sys_variable_value.value:
(function execute(inputs, outputs) {

//var competitors = "5334ac64478b46106a3eedf1d16d43f0,9197112b47e6c2106a3eedf1d16d4353,c5ebd4a0478b46106a3eedf1d16d4327,2b9d9c60478b46106a3eedf1d16d43ac,a3fddc24478b46106a3eedf1d16d4333,ce5c35e747aac2106a3eedf1d16d431b,f2aa75a747aac2106a3eedf1d16d432c,27ebfd2b47aac2106a3eedf1d16d439c,70193def476ac2106a3eedf1d16d4323,0b3ab5a747aac2106a3eedf1d16d432d,099b1c20478b46106a3eedf1d16d435e,d55d5d23472ac2106a3eedf1d16d4396,7b4a5820478b46106a3eedf1d16d4377,d11add2f47e6c2106a3eedf1d16d43d7,4d1b5d6f47e6c2106a3eedf1d16d4377,beaa1c20478b46106a3eedf1d16d437a";
var competitors = inputs.competitors
 if (competitors) {
        // Split the competitors string into an array of sys_ids
        var racers = competitors.split(',');

        // Shuffle the racers array randomly using Fisher-Yates shuffle algorithm
        for (var i = racers.length - 1; i > 0; i--) {
            var j = Math.floor(Math.random() * (i + 1));
            [racers[i], racers[j]] = [racers[j], racers[i]];
        }

        // Pair racers sequentially
        var reorderedRacers = [];
        for (var i = 0; i < racers.length; i += 2) {
            if (i + 1 < racers.length) {
                reorderedRacers.push(racers[i], racers[i + 1]);
            } else {
                reorderedRacers.push(racers[i]);
            }
        }

        outputs.data = JSON.stringify(reorderedRacers);
    }
    

})(inputs, outputs);

